import React from 'react';
import Link from 'next/link';


import Page from '../Components/Page/Page';


export default function Login() {
  return (
    <div>
      <Page>
        [Login-Page]
        <Link href="/Landing-page" title="Landing-Page">
          <a>Landing-page</a>
        </Link>
        <Link href="/Sign-up" title="Sign-up">
          <a>Sign-up</a>
        </Link>
      </Page>
    </div>
  );
}
